import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { solid, regular, brands } from '@fortawesome/fontawesome-svg-core/import.macro'
const cName = 'menu-item';
const menuItems = [
    {
        name: 'Today',
        path: '/',
        cName,
        dropdown: [<FontAwesomeIcon icon={solid('caret-right')}/>, <FontAwesomeIcon icon={solid('caret-right')}/>]
    },
    {
        name: 'Calandar',
        path: '/',
        cName
    },
    {
        name: 'Projects',
        path: '/',
        cName, 
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Uncatgorized',
        path: '/',
        cName,
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Tags',
        path: '/',
        cName,
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Notebook',
        path: '/',
        cName
    },
]

export default menuItems;
